import styled from 'styled-components';


export const HeaderWrapper = styled.div`
  padding:0;
  width:100vw;
  height:10vh;
  background:#333;
  display:grid;
  grid-template-columns:30% 50% 20%;
`;
 
const Header = () => {
 
    return (
        <HeaderWrapper>
            

        </HeaderWrapper>
      );
}
 
export default Header;
